import React, { Component } from "react";
import "./Navbar.css";
class Navbar extends Component {
  constructor() {
    super();
  }
  getAlgorithmType = () => {
    const { selectAlgo } = this.props;
    selectAlgo(document.getElementById("algorithm-type").value);
  };
  getSpeedValue = () => {
    const { selectSpeed } = this.props;
    selectAlgo(document.getElementById("algorithm-type").value);
  };
  render() {
    return (
      <div className="navBar">
        <span>
          Algorithms&nbsp;
          <select id="algorithm-type" onChange={this.getAlgorithmType}>
            <option value="dijkstra">Dijkstra</option>
            <option value="breadthFirst">Breadth First</option>
            <option value="depthFirst">Depth First</option>
            <option value="aStar">A Star</option>
          </select>
        </span>
        <span>
          Speed&nbsp;
          <input
            type="radio"
            id="1x"
            name="speed"
            value="1"
            checked
            onchange="getSpeedValue()"
          />
          <label htmlFor="male">1x</label>
          <input type="radio" id="2x" name="speed" value="2" />
          <label htmlFor="female">5x</label>
          <input type="radio" id="3x" name="speed" value="3" />
          <label htmlFor="other">Instant</label>
        </span>
        <span>
          <div className="startNode"></div>
          Start Node
        </span>
        <span>
          <div className="endNode"></div>
          End Node
        </span>
        <span>
          <div className="visitedNode"></div>
          Visited Nodes
        </span>
        <span>
          <div className="unvisitedNode"></div>
          Unvisited Nodes
        </span>
        <span>
          <div className="path"></div>
          Path
        </span>
      </div>
    );
  }
}
export default Navbar;
